<script>
  gameStart();

  function gameStart() {
    console.log('gameStart')
    if ("undefined" != typeof mraid) {
      "loading" === mraid.getState() ? mraid.addEventListener("ready", MRaidReadyCallback) : MRaidReadyCallback()
    }

    window.setTimeout(()=>{
      console.log('gameEnd')
      window.gameEnd && window.gameEnd()
    },3000)
  }

  function MRaidReadyCallback() {
    mraid.addEventListener('viewableChange', viewableChangeHandler);
    showMyAd();
  }

  function viewableChangeHandler(viewable) {
    if (viewable) {
      showMyAd();
    } else {
      //   pause
    }
  }

  window.onload = showMyAd;
  function showMyAd() {
    document.querySelector("#loading").style.display = "none";
    document.querySelector("#app_wrap").style.visibility = "visible";
  }

  function gameClose(){
    console.log('gameClose')
  }
</script>
